-- Dumping structure for procedure throwngo.usp_addLap
DROP PROCEDURE IF EXISTS `usp_addLap`;
DELIMITER //
CREATE PROCEDURE `usp_addLap`(
	IN `vDriverVRSID` VARCHAR(100),
	IN `vConfigVRSID` VARCHAR(100),
	IN `vSimDT` DATETIME,
	IN `vSessionDT` DATETIME,
	IN `vStintNum` DOUBLE,
	IN `vLapNum` DOUBLE,
	IN `vLapTime` DOUBLE,
	IN `vLapState` VARCHAR(50),
	IN `vAirTemp` DOUBLE,
	IN `vTrackTemp` DOUBLE,
	IN `vFuelUsed` DOUBLE,
	IN `vFuelLeft` DOUBLE








)
BEGIN

DECLARE vStart DATETIME;
DECLARE vEnd DATETIME;

SELECT c.StartDate, c.EndDate
INTO vStart, vEnd
FROM configuration c
WHERE c.VRSID = vConfigVRSID
ORDER BY c.Season DESC, c.WeekNum DESC
LIMIT 1;

IF vSessionDT >= vStart AND vSessionDT <= vEnd THEN
	IF (SELECT COUNT(*) FROM laps WHERE SessionDT = vSessionDT AND StintNum = vStintNum AND LapNum = vLapNum AND DriverVRSID = vDriverVRSID AND ConfigVRSID = vConfigVRSID) = 0 THEN
		INSERT laps (DriverVRSID, ConfigVRSID, SimDT, SessionDT, StintNum, LapNum, LapTime, LapState, AirTemp, trackTemp, FuelUsed, FuelLeft)
		SELECT vDriverVRSID, vConfigVRSID, vSimDT, vSessionDT, vStintNum, vLapNum, vLapTime, vLapState, vAirTemp, vTrackTemp, vFuelUsed, vFuelLeft;
		
		SELECT 1;
	ELSE
		SELECT 0;
	END IF;
ELSE
	SELECT 0;
END IF;

END//
DELIMITER ;

