-- Dumping structure for procedure throwngo.usp_getLapCounter
DROP PROCEDURE IF EXISTS `usp_getLapCounter`;
DELIMITER //
CREATE PROCEDURE `usp_getLapCounter`()
BEGIN

DECLARE vConfig VARCHAR(30);

SELECT VRSID
INTO vConfig
FROM configuration
WHERE StartDate < UTC_TIMESTAMP() AND EndDate > UTC_TIMESTAMP()
ORDER BY StartDate ASC
LIMIT 1;

SELECT 
	D.FullName, 
	SUM(CASE WHEN L.LapState = 'Clean' THEN 1 ELSE 0 END) CleanLaps,
	COUNT(*) TotalLaps,
	ROUND(SUM(CASE WHEN L.LapState = 'Clean' THEN 1 ELSE 0 END) / COUNT(*), 3) CleanPct
FROM vw_valid_laps L
LEFT JOIN drivers D
ON L.DriverVRSID = D.VRSID
WHERE L.ConfigVRSID = vConfig AND L.SessionDT >= (NOW() - INTERVAL 8 DAY)
GROUP BY L.DriverVRSID
ORDER BY TotalLaps DESC;

END//
DELIMITER ;

-- Dumping structure for procedure throwngo.usp_getLatestSession
DROP PROCEDURE IF EXISTS `usp_getLatestSession`;
DELIMITER //
CREATE PROCEDURE `usp_getLatestSession`(
	IN `vDriverName` VARCHAR(255)




)
BEGIN

DECLARE vDriverID VARCHAR(100);
DECLARE vSessionDT DATETIME;
DECLARE vMatches INT UNSIGNED;
DECLARE vConfig VARCHAR(30);
DECLARE vBlap DOUBLE;
DECLARE vPRlap DOUBLE;

SELECT VRSID
INTO vConfig
FROM configuration
WHERE StartDate < UTC_TIMESTAMP() AND EndDate > UTC_TIMESTAMP()
ORDER BY StartDate ASC
LIMIT 1;

SELECT COUNT(*)
INTO vMatches
FROM drivers D 
WHERE D.FullName LIKE CONCAT(vDriverName, '%');

IF vMatches > 1 THEN
	SELECT vMatches;
ELSEIF vMatches = 0 THEN
	SELECT 0;
ELSE
	SELECT D.VRSID, MAX(L.SessionDT) LatestSession
	INTO vDriverID, vSessionDT
	FROM laps L 
	LEFT JOIN drivers D 
	ON L.DriverVRSID = D.VRSID 
	WHERE D.FullName LIKE CONCAT(vDriverName, '%');
	
	SELECT MIN(LapTime) PRlap
	INTO vPRlap
	FROM vw_valid_laps
	WHERE ConfigVRSID = vConfig AND LapState = 'Clean' AND SessionDT >= (NOW() - INTERVAL 8 DAY) AND DriverVRSID = vDriverID;
	
	SELECT MIN(LapTime) Blap
	INTO vBlap
	FROM vw_valid_laps
	WHERE ConfigVRSID = vConfig AND LapState = 'Clean' AND SessionDT >= (NOW() - INTERVAL 8 DAY);
	
	SELECT L.*, ROUND(L.LapTime - vBlap, 3) GapLeader, ROUND(L.LapTime - vPRlap, 3) GapPR
	FROM laps L
	WHERE SessionDT = vSessionDT AND DriverVRSID = vDriverID AND L.LapState LIKE 'Clean'
	ORDER BY L.StintNum DESC, L.LapNum DESC;
END IF;

END//
DELIMITER ;

