CREATE PROCEDURE `usp_getLeaderboard`()
BEGIN

DECLARE vConfig VARCHAR(30);
DECLARE vBlap DOUBLE;

SELECT VRSID
INTO vConfig
FROM configuration
WHERE StartDate < UTC_TIMESTAMP() AND EndDate > UTC_TIMESTAMP()
ORDER BY StartDate ASC
LIMIT 1;

SELECT MIN(LapTime) Blap
INTO vBlap
FROM vw_valid_laps
WHERE ConfigVRSID = vConfig AND LapState = 'Clean' AND SessionDT >= (NOW() - INTERVAL 8 DAY);

SET @RowNum = 0;

SELECT LB2.Rank, P.Pts, LB2.FullName, LB2.Blap, ROUND(LB2.Blap - vBlap, 3) Gap
FROM (
	SELECT LB.FullName, LB.Blap, (@RowNum:=@RowNum + 1) Rank
