		FROM vw_valid_laps L
		LEFT JOIN drivers D
		ON L.DriverVRSID = D.VRSID
		WHERE L.ConfigVRSID = vConfig AND L.LapState = 'Clean' AND L.SessionDT >= (NOW() - INTERVAL 8 DAY) AND L.TrackTemp > 26
		GROUP BY D.FullName
		ORDER BY Blap ASC
	) LB
) LB2
LEFT JOIN points P
ON LB2.Rank = P.Pos;

