-- Dumping structure for procedure throwngo.usp_getLiveStandings
DROP PROCEDURE IF EXISTS `usp_getLiveStandings`;
DELIMITER //
CREATE PROCEDURE `usp_getLiveStandings`()
BEGIN

DECLARE vConfig VARCHAR(50);
DECLARE vSeason INT;
SET @RowNum = 0;

SELECT VRSID, Season
INTO vConfig, vSeason
FROM configuration
WHERE StartDate < UTC_TIMESTAMP() AND EndDate > UTC_TIMESTAMP()
ORDER BY StartDate ASC
LIMIT 1;

SELECT LP.FullName, SUM(LP.Pts) LivePts
FROM (
	SELECT R.VRSDriverID, D.FullName, R.Pts
	FROM results R
	LEFT JOIN drivers D
	ON R.VRSDriverID = D.VRSID
	WHERE R.Season = vSeason
	
	UNION ALL
	
	SELECT LB2.VRSID, LB2.FullName, P.Pts
	FROM (
		SELECT LB.VRSID, LB.FullName, LB.Blap, (@RowNum:=@RowNum + 1) Rank
		FROM (
			SELECT D.VRSID, D.FullName, MIN(L.LapTime) Blap
			FROM vw_valid_laps L
			LEFT JOIN drivers D
			ON L.DriverVRSID = D.VRSID
			LEFT JOIN configuration C
			ON L.ConfigVRSID = C.VRSID
			WHERE C.Season = vSeason AND C.VRSID = vConfig AND L.LapState = 'Clean' AND L.SessionDT >= (NOW() - INTERVAL 8 DAY)
			GROUP BY D.FullName
			ORDER BY Blap ASC
		) LB
	) LB2
	LEFT JOIN points P
	ON LB2.Rank = P.Pos
) LP
GROUP BY LP.VRSDriverID
ORDER BY SUM(LP.Pts) DESC;

END//
DELIMITER ;

